import React from 'react'
import Common from './Common'
import { NavLink } from 'react-router-dom';
import img from './work.svg'
const Home = () => {
    return (
        <>
            <Common
                name='Welcome to About Page'
                imgsrc={web}
                visit='/contact'
                btname='Contact Now' />
        </>
    )
}

export default Home;
